								if (typeof callback === "function") {
									self.TimoutArr.push(setTimeout(callback, delay));
								}
							}
							LoopExecution(callback, delay) {
								if (typeof callback === "function") {
									let b=setInterval(callback, delay);
									self.IntervalArr.push(b);
									return b;
								}
							}
							ClearRegisteringCallbacksAll()
							{
								for (let key in global.networkCtl._listener) {
									global.networkCtl._listener[key] = global.networkCtl._listener[key].filter(bb => bb.target != self);
								}
							}
							ClearRegisteringCallbacks()
							{
