											callback(message,(delay)=>{
												if(clean)
												{
													self.ClearRegisteringCallbacks();
												}
												resolve(delay);
											});
										})
								});
								function panduan_shifou_fuhuo(fuhuo,dieCallback)
								{
									//console.info(""+fuhuo);
									self.RegisterCallBack(fight.MSG_SC_RES_HP_MP_CHANGE,fight.ResHpMpChangeMessage,false,(message)=>{
										const actor = global.actorManager.GetActor(message.lid);
										//

											if(actor&&message.lid == global.gamePlayerController.GetMainPlayerID())
