												if (message && message.hp <= 0) {
													const hasTarget = Object.values(BackPackProxy.GetBagItemList()).some(obj => obj.id == 61012);
													if(fuhuo&&hasTarget)
													{
														self.DelayExecution(() => {
															console.info("");
