													}

												}
											}

									})
								}
								if(Object.keys(options).length === 0)
								{

									return morenPromise
								}else{
									let promise_arr=[morenPromise];
									if(options.delay)
									{
										promise_arr.push(self.getPromise((resolve)=>{
											resolve(options.delay);
