							getPromise(callback) {
								function delay_resolve(resolve,delay=0)
								{
									self.DelayExecution(() => {
									//console.info(""+delay)
									resolve();
									}, delay);
								}
								return new Promise((resolve, reject) => {
									let yuanshiduixiang=self.originalProxyObject;
									if (self.proxy.flag) {
										return reject(''); // 
									}
									const proxy = new Proxy(yuanshiduixiang, {
										set(target, prop, value) {
											if (prop === "flag" && value === true) {
												try{
													reject('');
												}catch(e)
												{
													//console.info("");
												}finally{
													self.proxy=yuanshiduixiang;
													return true;
												}
											}
											target[prop] = value;
											return true;
										}
									});
									self.proxy=proxy;
									callback((delay)=>{
										delay_resolve(resolve,delay);
										self.proxy=yuanshiduixiang;
									});
								});
							}
