							async  chongwupaiqian(){
								if(PetProxy.GetActivePetList().length <= 0){
									console.info("");
									return;
							    }
								//
								let finishedTask=Object.values(PetProxy.GetPetTaskList()).map((k)=>{
										return {...k,...PetProxy.GetPetTaskCfg(k.taskId)}
								}).filter((k)=>{ 
										return (k.state==1)&&(k.time-(GetServerMilliseconds() / 1000 - k.startTime))<=0;
								});
								if(finishedTask&&finishedTask.length > 0){
									for (const [index, item] of finishedTask.entries()) {
										await self.getPromise((resolve) => {
										PetProxy.RequestPetTaskReward(item.taskId); 
											resolve(1000);
										});
									}  
								}
								let tili = ItemFunction.default.GetItemNumberByItemId(85, { quick: 1, needBind: true }).havenum;
								if(tili < 10){
									//console.info("");
									return;
								}
								//
								let doTaskArr = [];
								let havaPet = PetProxy.GetActivePetList();
								let allTask = Object.values(PetProxy.GetPetTaskList()).map(item=>{
									const {id,num,rarity,special} = PetProxy.GetPetTaskCfg(item.taskId);
									return {id,num,rarity,special};
								})
								//console.info(allTask);
								const specialTasks = allTask.filter(task => 
									havaPet.includes(task.special) && 
									havaPet.length >= task.num
								).sort((a, b) => b.rarity - a.rarity); // 

								// 
								for (const task of specialTasks) {
									const needed = task.num;
									const selected = [task.special];
									const others = havaPet.filter(pet => pet !== task.special).slice(0, needed - 1);

									selected.push(...others);
									doTaskArr.push({ taskId: task.id, pets: selected });
									havaPet = havaPet.filter(pet => !selected.includes(pet));
								}
								// 
								const remainingTasks = allTask
									.filter(task => !doTaskArr.some(t => t.taskId === task.id)) // 
									.sort((a, b) => b.rarity - a.rarity);

									for (const task of remainingTasks) {
										if (havaPet.length < task.num) continue;
										const selected = havaPet.slice(0,task.num);
										doTaskArr.push({ taskId: task.id, pets: selected });
										havaPet = havaPet.slice(task.num);
									}
									//console.info("",doTaskArr);

									doTaskArr.forEach(item=>{
										PetProxy.RequestDoPetTask(item.taskId,item.pets);
									})
							}
